import React from "react";
import HomePageHeader from '../component/homepage/homepageheader/index'

let SearchListData = [
    {
        title: 'R',
        subtitle: 'raraar  qqq'
    }
]

function SearchList() {
    return (
        <>

            <div className="search-list-container">
                {SearchListData.map((d, i) => (
                    <div className="search-list-block">
                        <div className="search-list-title">{d.title}</div>
                        <div className="search-list-sub-title">{d.subtitle}</div>
                    </div>

                ))} 
                <HomePageHeader />
            </div>
        </>
    );
}

export default SearchList;
